// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract FactureTracker {
    // Struct pour une facture
    struct Facture {
        string client;
        string dateEnvoi;
        string statut;
        uint256 montant;
        uint256 tva;
        uint256 montantTva;
    }

    // Mapping pour lier un identifiant de facture à une facture
    mapping(uint256 => Facture) public factures;

    // Variable pour garder la trace de l'ID de la prochaine facture
    uint256 public nextId;

    // Fonction pour ajouter une facture
    function ajouterFacture(
        string memory client,
        string memory dateEnvoi,
        string memory statut,
        uint256 montant,
        uint256 tva
    ) public {
        uint256 montantTva = (montant * tva) / 100; // Calcul du montant de la TVA
        factures[nextId] = Facture(client, dateEnvoi, statut, montant, tva, montantTva);
        nextId++; // Incrémenter l'ID pour la prochaine facture
    }

    // Fonction pour obtenir une facture par ID
    function getFacture(uint256 id) public view returns (
        string memory client,
        string memory dateEnvoi,
        string memory statut,
        uint256 montant,
        uint256 tva,
        uint256 montantTva
    ) {
        Facture memory f = factures[id];
        return (f.client, f.dateEnvoi, f.statut, f.montant, f.tva, f.montantTva);
    }
}
